              <p style={{fontFamily: "'Press Start 2P', cursive", fontSize: '1.5vw' ,color: 'white', textAlign: 'center',marginTop: '6vh', position: 'relative', right: '0%'}}>FANIMISS</p>
              <p style={{fontFamily: "'Press Start 2P', cursive", fontSize: '1.5vw' ,color: 'white', textAlign: 'center', position: 'relative', right: '0%'}}>FANIMISS</p>
              <p style={{fontFamily: "'Press Start 2P', cursive", fontSize: '1.5vw' ,color: 'white', textAlign: 'center', position: 'relative', right: '0%'}}>FANIMISS</p>
            </div>

          </div>
        </div>                   
      </div>

    );
  }
}
